return item.id<2?
      (  <div key ={item.id}>
    <div>{item.id}</div>
    <div>{item.age}</div>
    <div>{item.name}</div>
        </div>
    ):null
     
   
      
    
 
        })
        return(
            <div>
   {theItems}
</div>
        );
    }
}
export default Items;
